import React from 'react';

function SearchBar({ ticker, onChange, onSearch }) {
  return (
    <div style={{ marginBottom: '20px' }}>
      <input
        type="text"
        value={ticker}
        onChange={onChange}
        placeholder="Enter COST or AMZN"
        style={{ padding: '10px', width: '250px' }}
      />
      <button onClick={onSearch} style={{ padding: '10px 15px', marginLeft: '10px' }}>
        Predict
      </button>
    </div>
  );
}

export default SearchBar;
